import React from "react";
import DataGrid, {
  Button,
  Card,
  Checkbox,
  GridColDef,
  IconButton,
} from "intelli-ui-components-library";
import { CopyIcon } from "../../assets/icons";
import styles from "./server.module.scss";

const Server = () => {
  const rows = [];
  const columns: GridColDef[] = [
    {
      field: "selected",
      displayName: "",
      description: "",
      sortable: false,
      renderCell: (row) => (
        <div style={{ width: "60px" }}>
          <Checkbox
            checked={row.selected}
            onChange={() => console.log(row.id)}
          />
        </div>
      ),
    },
    {
      field: "url",
      displayName: "URL",
      description: "",
      sortable: false,
      renderCell: (row) => <div style={{ width: "150px" }}>{row.url}</div>,
    },
    {
      field: "description",
      displayName: "Description",
      description: "",
      sortable: false,
      renderCell: (row) => (
        <div style={{ width: "150px" }}>{row.description}</div>
      ),
    },
  ];
  return (
    <div>
      <h1>Server</h1>
      <Card className={styles["title-section"]}>
        <div>
          <h3>All Servers</h3>
          <h5>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Mollitia,
            molestias
          </h5>
        </div>
        <div className={styles["button-group"]}>
          <Button>Duplicate</Button>
          <Button>Delete</Button>
          <Button>Add</Button>
        </div>
      </Card>
    </div>
  );
};
export default Server;
